$(window).on('load', function() {
    $('#preloader').delay(150).fadeOut('slow');
    $('#preloader_all').delay(10).fadeOut('slow');
    $('.titulo, .texto').css({ 'transform': 'translateY(150px)' }, 100);
    $anchos = $(window).width();
    $('#fullpage').fullpage({
        sectionSelector: '.vertical',
        setKeyboardScrolling: true,
        scrollingSpeed: 1200,
        lazyLoading: true,
        onLeave: function(index, nextIndex, direction) {

            if (nextIndex == 2 && direction == 'down') {
                $('#preloader').show(800);
                $('.menu').delay(150).animate({ opacity: 0 }, 500).fadeIn(700);
                $('.hdr1').delay(150).animate({ top: 0}, 10).fadeIn(700);
                $('.menu2').delay(150).fadeIn(700);
                $('.hdr2').delay(150).fadeIn(700);
                // $('.menu .wrap_menu').delay(150).fadeOut('slow');
                $('.movimiento').css({ 'transform': 'translate3d(0px, 0px, 0px) scale(1)' }, 100);
                $('.base').css({ 'transform': 'scale(1)' }, 100);
                $('.ventajas ul li').css({ 'opacity': 1, 'transform': 'scale(1.3)' }, 100);
                $('.titulo, .texto').css({ 'transform': 'translateY(150px)' }, 100);
            }

            if($anchos>520){
                if (nextIndex == 2 || nextIndex == 3 || nextIndex == 7) {
                    $('nav.menu2 a').css({'color':'white'}).fadeIn(500);
                    $('nav.menu2').css({'border-bottom': '1px solid #ffffff'}).fadeIn(500);
                    $('nav.menu2 a').hover(
                        function() {
                            $( this ).css({'color': '#5b5b5b'}).fadeIn(500);
                        }, function() {
                            $( this ).css({'color': 'white'}).fadeIn(500);
                        }
                    );

                }
                if (nextIndex == 4 || nextIndex == 6 || nextIndex == 5 ) {
                    $('nav.menu2 a').css({'color':'#a1a1a1'}).fadeIn(500);
                    $('nav.menu2').css({'border-bottom': '1px solid #a1a1a1'}).fadeIn(500);
                    $('nav.menu2 a').hover(
                        function() {
                            $( this ).css({'color': 'black'}).fadeIn(500);
                        }, function() {
                            $( this ).css({'color': '#a1a1a1'}).fadeIn(500);
                        }
                    );
                }
            }else{
                if (nextIndex == 2 || nextIndex == 3 || nextIndex == 5) {

                    $('nav.menu2 a').css({'color':'gray'});

                    $('#cam_logo').attr('src','img/logo.png');
                    $('.icon-barras').css({'color': '#fff'}).fadeIn(500);
                }
                if (nextIndex == 4 || nextIndex == 6) {
                    $('#cam_logo').attr('src','img/logo-interno.png')
                    $('.icon-barras').css({'color': '#a1a1a1'}).fadeIn(500);
                }
            }




            if (nextIndex == 1) {
                $('.menu2').fadeOut(700);
                $('.hdr2').fadeOut(700);
                $('.menu').animate({ opacity: 1 }, 100).fadeIn(700);;
                $('.hdr1').animate({ opacity: 1 }, 100).fadeIn(700);;
               
            }
            if (nextIndex == 2) {

                if ($(window).width() < 360) {
                    $('.movimiento2').css({ 'transform': 'translate3d(-16px, 0px, 0px) scale(1.15)' });

                } else {
                    $('.movimiento2').css({ 'transform': 'translate3d(-40px, 0px, 0px) scale(1.15)' });
                }

                $('.base2').css({ 'transform': 'translate3d(32px,0px,0px) scale(1.2)' });

            }
            if (nextIndex == 3) {

                if ($(window).width() < 575) {
                    $('.movimiento3').css({ 'transform': 'translate3d(0px,0px,0px) scale(1.2)' });
                } else {
                    $('.movimiento3').css({ 'transform': 'translate3d(-70px,0px,0px) scale(1.2)' });
                }
                $('.base3').css({ 'transform': 'translate3d(0px,0px,0px) scale(1.2)' });
            }
            if (nextIndex == 4) {
                $('.movimiento4').css({ 'transform': 'translate3d(30px,0px,0px) scale(1.1)' });
                $('.base4').css({ 'transform': 'translate3d(-180px,0px,0px) scale(1.2)' });
            }
            if (nextIndex == 5) {
                if ($(window).width() < 350) {
                    $('.movimiento5').css({ 'transform': 'translate3d(0px,0px,0px) scale(1.1)' });
                } else {
                    $('.movimiento5').css({ 'transform': 'translate3d(10px,0px,0px) scale(1.1)' });
                }
                if ($(window).width() < 575) {
                    $('.base5').css({ 'transform': 'translate3d(17px,0px,0px) scale(1.1)' });
                } else {
                    $('.base5').css({ 'transform': 'translate3d(30px,0px,0px) scale(1.1)' });
                }
            }
            if (nextIndex == 6) {
                if ($(window).width() < 575) {
                    $('.movimiento6').css({ 'transform': 'translate3d(-100px,50px,0px) scale(.8)' });
                } else {
                    $('.movimiento6').css({ 'transform': 'translate3d(-180px,50px,0px) scale(.8)' });
                }

                if ($(window).width() < 575) {
                    $('.base6').css({ 'transform': 'translate3d(100px,0px,0px) scale(1)' });
                } else {
                    $('.base6').css({ 'transform': 'translate3d(0px,0px,0px) scale(1)' });
                }


            }

        },

        afterLoad: function(anchorLink, index) {
            if (index == 1) {
                $('#preloader').delay(8).fadeOut('slow');
                $('.movimiento').css({ 'transform': 'translate3d(0px, 0px, 0px) scale(1.1)' }, 4000);
                $('.base').css({ 'transform': 'scale(1.1)' }, 3000);
                $('.ventajas ul li').css({ 'opacity': 1, 'transform': 'scale(1)' });
                $('.titulo, .texto').css({ 'transform': 'translateY(0px)' });
            }
            if (index != 2) {
                $('.base2').css({ 'transform': 'translate3d(-40px,0px,0px) scale(1.1.5)' }, 0);
                if ($(window).width() < 575) {
                    $('.movimiento2').css({ 'transform': 'translate3d(10px,0px,0px) scale(1.05)' }, 0);
                } else {
                    $('.movimiento2').css({ 'transform': 'translate3d(50px,0px,0px) scale(1.05)' }, 0);
                }
            }
            if (index != 3) {

                $('.base3').css({ 'transform': 'translate3d(00px,0px,0px) scale(1.1)' }, 0);
                $('.movimiento3').css({ 'transform': 'translate3d(50px,0px,0px) scale(1.1)' }, 0);
            }
            if (index != 4) {
                $('.base4').css({ 'transform': 'translate3d(20px,0px,0px) scale(1)' }, 0);
                $('.movimiento4').css({ 'transform': 'translate3d(200px,0px,0px) scale(1)' }, 0);
            }
            if (index != 5) {
                if ($(window).width() < 575) {
                    $('.base5').css({ 'transform': 'translate3d(-30px,0px,0px) scale(1.1)' }, 0);
                } else {
                    $('.base5').css({ 'transform': 'translate3d(-50px,0px,0px) scale(1.1)' }, 0);
                }

                if ($(window).width() < 350) {
                    $('.movimiento5').css({ 'transform': 'translate3d(-18px,0px,0px) scale(1.1)' }, 0);
                } else {
                    $('.movimiento5').css({ 'transform': 'translate3d(-130px,0px,0px) scale(1.1)' }, 0);
                }

            }
            if (index != 6) {
                if ($(window).width() < 575) {
                    $('.base6').css({ 'transform': 'translate3d(0px,0px,0px) scale(1)' }, 0);
                } else {
                    $('.base6').css({ 'transform': 'translate3d(-100px,0px,0px) scale(1)' }, 0);
                }

                $('.movimiento6').css({ 'transform': 'translate3d(-550px,50px,0px) scale(.8)' }, 0);
            }
        }
    });


    $('.ir1, .ir5, .ir6, .ir4').click(function(e) {
        var padre = $(this).parent().siblings('.ventana_flotante');
        if (padre.hasClass('activo')) {
            $(this).parent().siblings('.interno').fadeIn(400);
            padre.find('.fill').css({ 'background': 'rgba(0,0,0,.0)' });
            padre.fadeOut(600).removeClass('activo');
            padre.find('.absolute_rigth').animate({ 'right': '-50%' }, 600);
            $(this).find('div').css({ 'transform': 'rotate(0deg)' }).addClass('icon-text');
            $(this).removeClass('hover');
            $('.menu2').fadeIn(300);
        } else {
            $(this).parent().siblings('.interno').fadeOut(400);
            padre.find('.fill').css({ 'background': 'rgba(0,0,0,.3)' }).fadeIn(1200);
            padre.fadeIn(800).addClass('activo');
            padre.find('.absolute_rigth').animate({ 'right': 0 }, 600);
            $(this).find('div').css({ 'transform': 'rotate(180deg)' }).addClass('icon-cerrar');
            $(this).addClass('hover');
            $('.menu2').fadeOut(300);
        }
        e.preventDefault();
    })

    $('.fill').click(function(){
        var padre = $(this).parent().parent('.ventana_flotante');
        $(this).parent().siblings('.interno').fadeIn(400);
        padre.find('.fill').css({ 'background': 'rgba(0,0,0,.0)' });
        padre.fadeOut(600).removeClass('activo');
        padre.find('.absolute_rigth').animate({ 'right': '-50%' }, 600);

        $(this).removeClass('hover');
        $('.menu2').fadeIn(300);
        // $(this).css({ 'background': 'rgba(0,0,0,0)' }).fadeOut(1200);
        // $(this).siblings('.absolute_left').animate({ 'left': '-50%' }, 600);
        // $(this).siblings('.absolute_rigth').animate({ 'right': '-50%' }, 600);
    })


    $('.ir2, .ir3').click(function(e) {
        var abuelo = $(this).parent().siblings('.ventana_flotante');
        if (abuelo.hasClass('activo')) {
            $(this).parent().siblings('.interno').fadeIn(400);
            abuelo.find('.fill').css({ 'background': 'rgba(0,0,0,.0)' });
            abuelo.fadeOut(600).removeClass('activo');
            abuelo.find('.absolute_left').animate({ 'left': '-50%' }, 600);
            $(this).find('div').css({ 'transform': 'rotate(0deg)' }).addClass('icon-text');
            $(this).removeClass('hover');
            $('.menu2').fadeIn(300);
        } else {
            $(this).parent().siblings('.interno').fadeOut(400);
            abuelo.find('.fill').css({ 'background': 'rgba(0,0,0,.3)' }).fadeIn(1200);
            abuelo.fadeIn(800).addClass('activo');
            abuelo.find('.absolute_left').animate({ 'left': 0 }, 600);
            $(this).find('div').css({ 'transform': 'rotate(180deg)' }).addClass('icon-cerrar');
            $(this).addClass('hover');
            $('.menu2').fadeOut(300);
        }
        e.preventDefault();
    })


    $('.down').click(function(e) {
        e.preventDefault();
        $.fn.fullpage.moveSectionDown();
    });

});


$('.icon-barras').click(function(e) {
    $($(this).siblings('.wrap_menu')).slideToggle('slow');
});


